import Mixins from '@/mixins'
export default {
  mixins: [Mixins],
  props: {
    value: {
      type: Array
    },
    showBtn: {
      type: Boolean,
      default: false
    },
    eventList: {
      type: Array,
      required: true
    }
  },
  data () {
    return {
      minWidth: '120',
      multipleSelection: []
    }
  },
  methods: {
    handleSelectionChange (val) {
      this.multipleSelection = val
      this.$emit('input', this.multipleSelection)
    }
  },
  watch: {
    value (val) {
      this.multipleSelection = val
    }
  },
  computed: {
    tableHeight () {
      return window.innerHeight - 60 - 50 - 40 - 50
    }
  }
}
